import { ZodiacSignsDetail } from "./data";
function Aries(){

  
  const newdata= ZodiacSignsDetail.find((ZodiacSignsDetail)=> ZodiacSignsDetail.Id === 1);
        
    const {Name, MyanmarMonth,ZodiacSign2ImageUrl,Dates,Title0,Element,ElementImageUrl,Title1,LifePurpose,
      Title2,Loyal,Title3,RepresentativeFlower,Title4,Angry,Title5,Character,Title6,PrettyFeatures
    
    
    }= newdata;
    console.log(newdata)
   

  return (<div> 
   
      <h1 className="div1">{Name}</h1>
  <h1 className="div1">{MyanmarMonth}</h1>
  <h4 className="div1">{Title0}</h4>
            <h4 className="div1">{Element}</h4>
 
            <div className="img1"> <img src={ZodiacSign2ImageUrl} alt={Name} /></div>
            <div className="">
              <h2 className="div2">{Title1}</h2>
              <h5  className="div2">{LifePurpose}</h5>
              <h2></h2>
              <h6></h6>

            
            </div>
            <div className="img2"> <img src={ElementImageUrl} alt={Name}/></div>
            <div className="body"></div>
            
  
  
  </div>
  )

};
export default Aries;
